/*INSERT INTO patentFamilies (appln_id,docdb_family_id, publn_auth, appln_filing_date, publn_date, jurisdiction, death)
SELECT appln_id, docdb_family_id, publn_auth, MIN(appln_filing_date), publn_date, l501ep AS jurisdiction, NULL AS death 
FROM tls201_appln 
JOIN tls211_pat_publn USING(appln_id)
JOIN tls218_docdb_fam USING(appln_id)
JOIN tls221_inpadoc_prs USING(appln_id)
WHERE publn_auth = 'EP'
AND publn_kind = 'B1' -- Only grants 
AND l501ep != '' -- Exclude missing

INSERT INTO patentFamilies (appln_id,docdb_family_id, publn_auth, appln_filing_date, publn_date, jurisdiction, death)
SELECT appln_id,docdb_family_id, pub1.publn_auth, MIN(appln_filing_date), pub1.publn_date, pub1.publn_auth AS jurisdiction, NULL AS death 
FROM tls201_appln 
JOIN tls211_pat_publn pub1 USING(appln_id)
JOIN tls211_pat_publn pub2 USING(appln_id)
JOIN tls218_docdb_fam USING(appln_id)
WHERE pub1.publn_auth = 'EP'
AND pub1.publn_kind = 'A1' -- Only applications
AND pub2.publn_kind != 'B1' 
*/

